import React, { useEffect, useState } from "react";
import axios from "axios";

const AdminDashboard = () => {
  const [feedbacks, setFeedbacks] = useState([]);
  const [filtered, setFiltered] = useState([]);
  const [loading, setLoading] = useState(true);
  const [deletingId, setDeletingId] = useState(null);
  const [searchTerm, setSearchTerm] = useState("");

  // Fetch feedbacks on mount
  useEffect(() => {
    const fetchFeedbacks = async () => {
      try {
        const response = await axios.get("http://localhost:5000/api/feedbacks");
        if (response.data.success) {
          setFeedbacks(response.data.feedbacks);
          setFiltered(response.data.feedbacks);
        } else {
          console.error("Failed to fetch feedbacks");
        }
      } catch (error) {
        console.error("❌ Error fetching feedbacks:", error);
      } finally {
        setLoading(false);
      }
    };

    fetchFeedbacks();
  }, []);

  // Filter feedbacks by search term
  const handleSearch = (e) => {
    const term = e.target.value.toLowerCase();
    setSearchTerm(term);

    if (!term) {
      setFiltered(feedbacks);
      return;
    }

    const filteredList = feedbacks.filter((fb) =>
      fb.name.toLowerCase().includes(term) ||
      fb.email.toLowerCase().includes(term) ||
      fb.course.toLowerCase().includes(term)
    );

    setFiltered(filteredList);
  };

  // Delete feedback by id
  const handleDelete = async (id) => {
    if (!window.confirm("Are you sure you want to delete this feedback?")) return;

    try {
      setDeletingId(id);
      
      const updatedFeedbacks = feedbacks.filter((fb) => fb._id !== id);
      setFeedbacks(updatedFeedbacks);
      setFiltered(updatedFeedbacks);
    } catch (error) {
      alert("Error deleting feedback!");
      console.error(error);
    } finally {
      setDeletingId(null);
    }
  };

  return (
    <div className="min-h-screen bg-gradient-to-tr from-purple-600 via-indigo-600 to-blue-500 flex flex-col items-center px-4 py-8">
      <div className="max-w-7xl w-full bg-white/20 backdrop-blur-lg rounded-2xl shadow-2xl p-8 border border-white/30">
        <h1 className="text-4xl font-bold mb-8 text-center text-indigo-100 drop-shadow">
          Student Feedback Dashboard
        </h1>

        {/* Search */}
        <div className="mb-8 flex justify-center">
          <input
            type="text"
            placeholder="Search by name, email, or course..."
            value={searchTerm}
            onChange={handleSearch}
            className="w-full max-w-2xl px-4 py-3 rounded-xl border border-indigo-300 focus:outline-none focus:ring-2 focus:ring-indigo-500"
          />
        </div>

        {/* Loading */}
        {loading ? (
          <p className="text-indigo-100 text-center text-xl">Loading feedbacks...</p>
        ) : filtered.length === 0 ? (
          <p className="text-indigo-200 text-center text-lg">No feedbacks found.</p>
        ) : (
          <div className="grid gap-6 sm:grid-cols-1 md:grid-cols-2 lg:grid-cols-3">
            {filtered.map((fb) => (
              <div
                key={fb._id}
                className="bg-white rounded-xl shadow-lg p-6 flex flex-col justify-between"
              >
                <div>
                  <h2 className="text-xl font-semibold text-indigo-900 mb-1">
                    {fb.name}{" "}
                    <span className="text-sm text-gray-600">&lt;{fb.email}&gt;</span>
                  </h2>
                  <p className="mb-1">
                    <strong>Course:</strong> {fb.course}
                  </p>
                  <p className="mb-1">
                    <strong>Rating:</strong>{" "}
                    <span className="text-yellow-400 ml-2">
                      {"⭐".repeat(fb.rating)}
                    </span>{" "}
                    / 5
                  </p>
                  <p className="mb-3 text-gray-700 italic">{fb.comments || "No comments"}</p>
                  <p className="text-xs text-gray-500">
                    Submitted: {new Date(fb.createdAt).toLocaleString()}
                  </p>
                </div>

                <button
                  disabled={deletingId === fb._id}
                  onClick={() => handleDelete(fb._id)}
                  className={`mt-4 px-4 py-2 rounded-lg text-white font-semibold transition ${
                    deletingId === fb._id
                      ? "bg-gray-400 cursor-not-allowed"
                      : "bg-red-600 hover:bg-red-700"
                  }`}
                >
                  {deletingId === fb._id ? "Deleting..." : "Delete"}
                </button>
              </div>
            ))}
          </div>
        )}
      </div>
    </div>
  );
};

export default AdminDashboard;
